import React, {handleClick} from 'react';

function Menu(props) {

    function handleClick() {
        this.setState({
            open: !this.state.open
        })
    }




    return (
        <div>

        <HamburgerMenu
            isOpen={this.state.open}
            menuClicked={this.handleClick.bind(this)}
            width={18}
            height={15}
            strokeWidth={1}
            rotate={0}
            color='black'
            borderRadius={0}
            animationDuration={0.5}
        />


        </div>
    );
}

export default Menu;
